import React, { Component } from "react";

class Leaderboard extends Component {
  render() {
    return (
      <div>
        <h2>Leaderboard</h2>
        <p>You can see the full leaderboards    
              <a href="http://www.facebook.com"> here</a>.
        </p>
        <div>
          <p>1. Ali Tehrani Jamsaz - 1,000,000</p>
          <p>2. Tyler Krueger      - 532,679</p>
          <p>3. Jon Kelly          - 14</p>
        </div>
      </div>
    );
  }
}

export default Leaderboard;
